import { createTheme } from "@material-ui/core";
import {muiTextField} from './textfield_overrides'
i

export const darkTheme = createTheme({
    palette: {
        primary: {
            main: colors.green[400],
            contrastText: "#fafafa",
        },
        secondary: {
            main: "#3664F9",
        },
        tertiary: {
            main: "#7F5FFF",
            contrastText: "#fafafa",
        },
        info: {
            main: "#7F5FFF",
        },
        warning: {
            main: "#FFCC26",
        },

        error: {
            main: "#ff5c41",
        },
        default: {
            main: "#bfbfbf",
        },
        mode: "dark",

        background: {
            default: "#121212",
        },
    },
    overrides:{
        MuiTextField: muiTextField
    }
});
